import React from 'react';
import './App.css';
import HomepageImage from './components/HomepageImage';

function App(props) {
  console.log(props);
  const subject = props.subject;
  return (
    <div className="App">
      <header className="App-header">
        <HomepageImage />
        <p>
          Hello, {subject}!I am Dian CHEN
        </p>
      </header>
    </div>
  );
}

export default App;
